import { ElementStates } from "../../types/element-states";
import { IArrEl } from "../../utils/utils";

interface IList<T> {
  list: T[];
  push: (item: T, array) => void;
  pop: () => void;
  shift: () => void;
  unshift: (item: T, array: T[]) => void;
  splice: () => void;
  getSize: () => number;
}

class List<IArrEl> implements IList<IArrEl> {
  list = [];
  head = -1;
  tail = -1;
  currentIndex = 0;
  private maxSize = 6;

  push = (item: IArrEl, array): void => {
    if (this.getSize() < this.maxSize) {
      array.push(item);
      this.tail = this.getSize()-1
      this.list = array;
    }
  };

  pop = (): void => {
    if (this.getSize()) {
      this.list.pop();
    }
  };

  shift = (item: IArrEl) => {};

  unshift = (item: IArrEl, array: IArrEl[]) => {
    array.unshift(item);
    this.list = array;
    this.head = 0;
    this.tail = this.getSize() - 1;
  };

  print = () => this.list;

  splice = (index: number, item: IArrEl, array: string[]) => {
    if (this.getSize() < this.maxSize) {
      array.splice(index, 1, item);
      if (this.head === -1) {
        this.head++;
      }
      this.tail++;
      this.currentIndex++;
      this.list = array;
    } else {
      throw new Error("Слишком много элементов");
    }
  };

  getSize = () => this.list.length;
}
export const list = new List();
